import React, { useState } from "react";

import "./SignUp.css";

const Register = () => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  return (
    <form className="signUpForm">
      <label>이메일</label>
      <input type="email"  value={email} className="input_signup" />
      <label>비밀번호</label>
      <input type="password" value={password} className="input_signup" />
      <label>닉네임</label>
      <input type="nickname" name="userNickname" className="input_signup" />
      <button type="submit" className="signUpBtn">
        가입하기
      </button>
    </form>
  );
};

export default Register;
